import React from "react";
import "../styles/Home.css";

function Home() {
  return (
    <section className="home">
      <div className="hero-content">
        <h1>Hi, I'm <span>ZAINAB</span></h1>
        <p>Frontend Developer • Dream Chaser • Creative Mind</p>
        <button>View My Work</button>
      </div>
    </section>
  );
}

export default Home;
